import Chase from "../assets/png/chase.png";
import Marshall from "../assets/png/chase.png";
import Rocky from "../assets/png/chase.png";
import Rubble from "../assets/png/chase.png";
import Skye from "../assets/png/chase.png";
import Zuma from "../assets/png/chase.png";

export const DUMMY_CARDS = [
  { color: "#e6194B", id: 1, flipped: true },
  { color: "#bfef45", id: 2, flipped: true },
  { color: "#42d4f4", id: 3, flipped: true },
  { color: "#42d4f4", id: 4, flipped: true },
  { color: "#bfef45", id: 5, flipped: true },
  { color: "#e6194B", id: 6, flipped: true },
  { color: "#e6194B", id: 7, flipped: true },
  { color: "#bfef45", id: 8, flipped: true },
  { color: "#42d4f4", id: 9, flipped: true },
  { color: "#42d4f4", id: 10, flipped: true },
  { color: "#bfef45", id: 11, flipped: true },
  { color: "#e6194B", id: 12, flipped: true },
].sort(() => Math.random() - 0.5);

export const CardsIcons = [
  { image: Chase, id: 1, flipped: false },
  { image: Marshall, id: 2, flipped: false },
  { image: Rocky, id: 3, flipped: false },
  { image: Rubble, id: 4, flipped: false },
  { image: Skye, id: 5, flipped: false },
  { image: Zuma, id: 6, flipped: false },
];
